    return <div className="col-4" key={products.id}>
        <div className="card h-100 shadow-sm text-center">
            <img src={products.Image} className="card-img-top" alt="..." />
            <div className="card-body">
                <h5 className="card-title">
                    {products.name}
                </h5>
                {/* <FaStar className='fa-star fs-4'/>{products.rating} */}
                <Rating />{products.rating}
                <div>â‚¹<span className='fs-3'>{products.price}</span></div>
                
                <div className="d-grid gap-2 my-4">
                    <Link className="btn Offer-btn" to={`/product/${products.id}`}>Check offer</Link>
                </div>
            </div>
        </div>
    </div>
}

export default Productlist
